import { Fragment } from 'react'
import QuoteList from '../components/quotes/QuoteList'

const DUMMY_QUOTES = [
    { id: '1', author: 'Orkhan', text: 'Dummy quote 1' },
    { id: '2', author: 'Ali', text: 'Dummy quote 2' },
    { id: '3', author: 'Rasul', text: 'Dummy quote 3' },
    { id: '4', author: 'Hashim', text: 'Dummy quote 4' },
]

const AllQuotes = () => {
    return (
        <Fragment>
            <QuoteList quotes={DUMMY_QUOTES}/>
        </Fragment>
    )
}
export default AllQuotes;
